(1814,  10, 154,  0,  0,  0,  0,  0,  1,  'http://www.npg.org.uk/index.php',  '3db2daf6c9d5328c36c9a261a1894f5849afc682', 'National Portrait Gallery, St Martin\'s Place, London',  'WC2H 0HE', '', NULL, 'The National Portrait Gallery is next to the National Gallery in Trafalgar Square.  It was the first portrait gallery in the world to collect portraits of important British men and women.  Today it houses more than 120,000 portraits from the 16th Century to the present day including photographs, caricatures, paintings, drawings and sculpture.  Entrance is free of charge, with chargeable temporary exhibitions and annual painting and photography prizes.',  ' ',  '020 7306 0055',  '', '', '', '', '', 'http://www.facebook.com/nationalportraitgallery',  '', 'http://www.flickr.com/photos/natportraitgallery',  'http://www.youtube.com/user/natportraitgallery', '2011-07-15 01:00:16',  '2013-09-09 03:46:23',  '2013-09-09 03:46:23',  'Y',  'National Portrait Gallery - Home', '', 'NPG',  '', NULL, 'Y',  '', 0,  'N',  'National Portrait Gallery',  'saved',  '2017-12-29 12:36:26',  '2017-12-29 12:36:26'),
(1820,  10, 154,  0,  0,  0,  0,  0,  1,  'http://www.royalacademy.org.uk/',  '0cb761e1239950a8ebbaf29bce4e5c585adc57a3', 'Burlington House, Piccadilly, London', 'W1J 0BD',  '', NULL, 'The Royal Academy of Arts is an independent, privately funded institution that occupies Burlington House, on Piccadilly. It was founded in 1768 by a group of prominent artists and architects as a venue for exhibitions and the first formal art school in Britain.  Today the academy  is best known for the Summer Exhibition which displays a wide range of new work by both established and unknown artists.', '', '020 7300 8000',  '', '', '', '', '', '', '', '', '', '2011-07-08 13:46:24',  '2013-09-09 03:46:23',  '2013-09-09 03:46:23',  'Y',  'Royal Academy Home -  Royal Academy of Arts',  '', 'Royal Academy of Arts, Royal Academy, Royal Academy London, Royal Academicians, free exhibitions, exhibitions in London, museum, Academicians, Friends of the Royal Academy, Research Library and Archive, John Madejski Fine Rooms, Hugh Casson Room for Friends, Friends Room, Sackler Wing of Galleries, Burlington House, Piccadilly, RA Magazine, RA Enterprises, Norman Rosenthal, exhibitions in London, art galleries in London, historic collections, historic houses, free exhibitions in London, British art scene, British art world, contemporary art, see exhibitions, British art, British culture, Joshua Reynolds, Thomas Gainsborough, John Constable, David Hockney, AARAT, American Associates of the Royal Academy Trust, Benjamin West Group, RA Schools, Premiums, RA Schools Show, Summer Exhibition, Forums, Focus, Architecture Programme, lectures and events, museum in Londonroyal art gallery london, royal academy london museum, royal academy london exhibits, art academy london, royal academie london, art exhibit london, piccadilly art gallery, royal academy of arts uk, academy of art uk, royal academy arts piccadilly, royal academy w1, royal art gallery, the royal academy exhibitions, royal academy londres, academy of fine arts in london, royal academy museum, royal academy of fine art, royal arts academy, royal art london, royal art museum, london academy of art, royal academy for the arts, royal academy of fine arts, royal accademy, royal academy of england, royale academy londres', 'This is the website of the Royal Academy of Arts, London. The Royal Academy has free exhibitions and paid-entry exhibitions all year round in its historic galleries on Piccadilly in London\'s West End. On this site you can buy tickets for our exhibitions and read more about the Royal Academy of Arts, the RA Schools, the Collections and Library, RA Magazine, the RA Architecture Programme, our Education Programme and Corporate Services. One of London\'s leading art galleries and museums with exhibitions all year round, including Rodin, Chola, Citizens and Kings, the Unknown Monet, Impressionists by the Sea and Summer Exhibition 2007.',  NULL, 'Y',  '', 0,  'Y',  'Royal Academy of Arts',  'saved',  '2017-12-29 12:36:29',  '2017-12-29 12:36:29'),
