(58897, 14, 36, NULL, NULL, 0,  0,  0,  1,  'http://www.williamsf1.com/', '2c928d0bf7dc12210bfc6dafed53cb1e35094984', '', NULL, NULL, NULL, '', '', '', '', '', '', '', '', '', '', '', '', '2011-07-05 01:00:05',  '2013-09-09 03:46:13',  '2013-09-09 03:46:13',  'Y',  'Williams', '', '', 'Williams is one of the worlds leading Formula One teams. It exists purely to race in the top echelon of motor racing, where its been winning grands prix for more than three decades.  \r\n\r\nThe Williams name has been synonymous with top-level motorsport since the 1960s. After running teams on the sports nursery slopes, team patron Frank Williams founded Frank Williams (Racing Cars) in 1966 and he entered F1 in 1969 with his friend Piers Courage behind the wheel.\r\n\r\nFrank quickly earned a reputation as one of the industrys more determined individuals and after selling his controlling interest in his original team, he established Williams Grand Prix Engineering with British engineer Patrick Head in 1977. They built their first car, the FW06, the following year and the team immediately went from strength-to-strength.  Williams is now the third most successful team on the grid.',  NULL, 'Y',  '', 0,  'N',  'Williams F1',  'saved',  '2017-12-29 13:15:06',  '2017-12-29 13:15:06'),
