(81605, 14, 424,  239,  3,  96, 18, 0,  1,  'http://www.bloomsburylanes.com/',  '23ac52b73a1237b16041b32a07d0223d5c3caa38', 'Bloomsbury Bowling LanesBasement of Tavistock HotelBedford WayLondon ',  'WC1H 9EU', 'info@bloomsburybowling.com', NULL, 'Bloomsbury Bowling Lanes\n&nbsp;\nType:\nEntertainment &amp; Arts - Nightlife\n&nbsp;\nBloomsbury Lanes: A One Off in London\n\nForget bowling past, the Bloomsbury Bowling Lanes is totally unique for London or indeed anywhere!\n\nBloomsbury is a one off venue that takes a lead for 1950\'s America, where bowling was the height of style.\n\nLook closely and you will notice features such as our sleek above lane ball returns (sourced from Canada of all places), our bar made from old bowling lanes wood and our pristine 1950\'s carpet, which had spend 40 years in storage before we found it.\n\nMany of our guests comment about the fantastic atmosphere in the venue. This is due to the vibrant mix of people whom we attract but also the care and time our team put into the venue. \n\nWhat makes Bloomsbury special is its status as a one off creation. As we are not part of a chain or concept, you will find better service, customer attention and excellent value for money. You might even find the owners taking your booking or serving your drinks!',  'info@bloomsburybowling.com', '02071831979',  '', 'Maria Mannoukas',  'Bloomsbury Lanes', 'Reception',  '', '', '', '', '', '2011-07-05 01:00:10',  '2013-09-09 03:46:03',  '2013-09-09 03:46:03',  'Y',  'Bloomsbury Bowling', '', '', '', NULL, 'Y',  '', 0,  'N',  'Bloomsbury Bowling', 'saved',  '2017-12-29 13:15:52',  '2017-12-29 13:15:52'),
